import React from 'react'
import './PrijaviSe.css'

function PrijaviSe() {
    return (
        <div className="prijavise">
            <p className="prijavise__header">Prijavi se</p>
            <p className="prijavise__description">Ispuni formu i prijavi se online na jednostavan i brz način.</p>
            <button className="btn prijavise__btn">Prijavi se</button>
        </div>
    )
}

export default PrijaviSe
